const getTitleCase = (text) => {
  const result = text.replace(/([A-Z])/g, " $1");
  const finalResult = result.charAt(0).toUpperCase() + result.slice(1);
  return finalResult;
};

function createInitialState(labels, samples = []) {
  const initialState = {};
  labels.forEach((label, index) => {
    initialState[label] = {
      text: samples[index] || "",
      placeholder: getTitleCase(label),
      key: label
    };
  });
  return initialState;
}

export function getInitialState(labels) {
  return createInitialState(labels, "");
}

export function getSamples(labels, samples) {
  return createInitialState(labels, samples);
}

export const base64Image =
  "data:image/png;base64,";

export const base64ImageSample =
  "data:image/jpeg;base64,";
